import { Tabs, Box, Tab, Rating } from '@mui/material';
import React, { useState } from 'react';
import { Link, NavLink, useParams } from "react-router";
import "../../styles/styles.scss";
import { TabPanel } from '@mui/lab';
import RatingAndDistance from "../../components/RatingAndDistance";
import OrderGroupButton from "../../components/Button/OrderGroupButton";
import ScheduleOrderButton from "../../components/Button/ScheduleOrderButton";

const RestaurantPage = () => {

  let { id } = useParams();

  return (
    <div>
      <div className="container-horizontal">
        <div style={{
          flex: 2
        }}>
          <div className="container-vertical"
            style={{
              minHeight: '270px'
            }}>
            <h1 className="bold-text title">McDonald's® (Adams  Wells)</h1>
            <p className="subtitle">
              Chinese
              Dim Sum
              Noodles
              Thai
              Open until 22:45
              £4.49 delivery
              £7.00 minimum
              1.94 miles away
              107 Lever Street, London, EC1V3RQ
              View map
            </p>
            <RatingAndDistance />
            <div className="container-horizontal">
              <OrderGroupButton />
              <ScheduleOrderButton />
            </div>
          </div>
          <div style={{ flex: 1 }}>
            <div style={{ height: '100px', width: '100%' }}>
              <Box sx={{ borderBottom: 1, borderColor: 'divider', marginTop: '10px', marginLeft: '0px' }}>
                <Tabs>
                  <Tab label="Burgers" value="0" />
                  <Tab label="Chickens" value="1" />
                  <Tab label="Hot Dogs & Chili" value="2" />
                  <Tab label="Specialty Pasta" value="3" />
                  <Tab label="Beef-n-Sausage Sandwiches" value="4" />
                </Tabs>
              </Box>
            </div>
          </div>

        </div>

        <div
          style={{
            flex: 1,
          }}>
          <img
            style={{
              height: '220px',
              width: '100%'
            }}
            src="https://cdn.concreteplayground.com/content/uploads/2020/04/Family-Feast-KFC-supplied.jpg" />
        </div>
      </div>
    </div>
  );
}
export default RestaurantPage
